// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

contract DariToken {

    // Declaraciones 
    string public name = "DARI Token";
    string public symbol = "DARI";
    uint256 public totalSupply = 1000000000000000000000000; 
    uint8 public decimals = 18;

    address payable public owner;

    // Evento para la transferencia de tokens de un usuario
    event Transfer (
        address indexed _from,
        address indexed _to,
        uint256 _value
    );

    // Evento para la aprobacion de un operador
    event Approval (
        address indexed _owner, 
        address indexed _spender, 
        uint256 _value
    );

    // Estructuras de datos 
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint)) public allowance;

    // Constructor 
    constructor(){
        balanceOf[msg.sender] = totalSupply;
        owner = payable(msg.sender);
    }

    // Transferencia de tokens de un usuario
    function transfer(address _to, uint256 _value) public returns (bool success){
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    // Aprobacion de una cantidad para ser gastada por un operador
    function approve(address _spender, uint256 _value) public returns (bool success){
        allowance[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    // Transferencia de tokens especificando el emisor
    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success){
        require(_value <= balanceOf[_from]);
        require(_value <= allowance[_from][msg.sender]);
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        emit Transfer(_from, _to, _value);
        return true;
    }

    //Compra de tokens


// Precio en ethers por token DARI (ajusta este valor según tus necesidades)
uint256 public tokenPriceInWei = 1000000000000000; // 0.001 ETH

// Evento para registrar las compras de tokens
event TokensPurchased(
    address indexed buyer,
    uint256 amount,
    uint256 cost
);

// Función para que los usuarios compren tokens DARI
function purchaseTokens(uint256 numberOfTokens) public payable returns (bool success) {
    require(numberOfTokens > 0, "La cantidad de tokens debe ser mayor que 0");
    require(msg.value >= numberOfTokens * tokenPriceInWei, "No se ha enviado suficiente ether");

    // Calcular el costo total en ethers
    uint256 totalCost = numberOfTokens * tokenPriceInWei;

    // Verificar si hay suficientes tokens disponibles para la compra
    require(balanceOf[owner] >= numberOfTokens, "No hay suficientes tokens disponibles para la compra");

    // Realizar la transferencia de tokens al comprador
    balanceOf[owner] -= numberOfTokens;
    balanceOf[msg.sender] += numberOfTokens;

    // Transferir ethers al propietario del contrato
    owner.transfer(totalCost);

    // Emitir el evento de compra de tokens
    emit TokensPurchased(msg.sender, numberOfTokens, totalCost);

    return true;
}

}
